// components/ProjectTile.js

import React from 'react';
import './ProjectTile.css'; // Assuming you have created ProjectTile.css for styling
import quizImage from '../assets/quiz-game.jpg'; // Adjust the path based on your actual folder structure
import financeImage from '../assets/finance-tracker.jpg'; // Adjust the path based on your actual folder structure

const ProjectTile = ({ project }) => {
  const { name, description, homepage, html_url } = project;
  let imagePath;

  // Determine image path based on project name
  if (name === 'Quiz-Game') {
    imagePath = quizImage;
  } else if (name === 'Finance \-Tracker') {
    imagePath = financeImage;
  } else {
    // Default image path if not specified for other projects
    imagePath = ''; // Add default image path if needed
  }

  return (
    <div className="project-tile">
      <h2>{name}</h2>
      <p>{description}</p>
      <div className="project-details">
        <img src={imagePath} alt={name} className="project-image" />
        <div className="project-links">
          <a href={html_url} target="_blank" rel="noopener noreferrer">GitHub Repo</a>
        </div>
      </div>
    </div>
  );
};

export default ProjectTile;
